const Planning = ({recipes}) => {

    const [monday, setMonday] = useState([]);

    function checkBreakfast(recipe){
        return recipe.name = 'Sausage And Egg Salad';
    }

    function breakfastWeek(recipes){
        const breakfast = recipes.find(checkBreakfast);
        setMonday(breakfast)
        console.log(breakfast);
    }

    return(
        <div>This is my planning
        {breakfastWeek(recipes)}
        </div>
    )

}

export default Planning;
